import Link from 'next/link';

export default function List({ factList }) {
  return (
    <div>
      {factList &&
        factList.all.slice(0, 30).map((e, i) => (
          <div key={i}>
            <Link as={`/${e.user.name.first}/${e.id}`} href='/[user]/[id]'>
              <a>
                {e.user.name.first} {e.user.name.last}
              </a>
            </Link>
          </div>
        ))}
    </div>
  );
}

List.getInitialProps = async () => {
  const response = await fetch('https://cat-fact.herokuapp.com/facts');
  const factList = await response.json();
  return { factList };
};
